comments.query:
query comments($postId: Int!, $page: Int, $token: String) {

  comments(postId: $postId, page: $page, token: $token)
  { 
    items {
        id
        authorUsername
        authorId
        authorLevel
        body
        isNewUser
        status
        deleteReason
        seqId
        date
    }
    pageInfo {
        hasNextPage
    }
 }

  }

postContact.query:
query postContact($postId: Int!, $isManualRequest: Boolean) {

  postContact(postId: $postId, isManualRequest: $isManualRequest)
  { 
    contactText
    contactMobile
 }

  }

Profile.query:
query profile($id: ID!) {

  profile(id: $id)
  { 
    id
    handler
    type
    description
    pages {
      id
      title
      order
      content
    }
    locations {
        id
        value
        description
    }
    contacts {
        id
        description
        info
        type
    }
    verifications {
        id
        type
        status
        data
    }
    updatedAt 
 }

  }

user.query:
query user($username: String) {

  user(username: $username)
  { 
		id
		username
		registrationDate
		mobile
		discount
		isMember
		isAdmin
		isBlocked
		didPay
		lastSeen
		countFollowers
		ratingSummery {
        upRank
        downRank
        rateAverage
		}
		badges {
		    badge
		}
 }

  }
